bioghist.p:
Bij brief van 24 juli 1828, nummer 247, werden door de commissaris-generaal aan de gouverneur-generaal van de West-Indische bezittingen toegezonden:


Algemene bepalingen voor de curatele- en onbeheerde boedelkamer;

Bedenkingen op de instructie voor de weeskamer;

Memorie van toelichting behorende bij de bedenkingen op de instructie van de curatele- en onbeheerde boedelkamer.
